tinymce.PluginManager.add("code",function(b){function a(){b.windowManager.open({title:"Source code",body:{type:"textbox",name:"code",multiline:!0,minWidth:600,minHeight:500,value:b.getContent({source_view:!0}),spellcheck:!1},onSubmit:function(c){b.setContent(c.data.code)}})}b.addButton("code",{icon:"code",tooltip:"Source code",onclick:a}),b.addMenuItem("code",{icon:"code",text:"Source code",context:"tools",onclick:a})});